"""Replace Elements with Greatest Element on Right Side"""
def replace_elements(arr):
    #edge cases
    if len(arr) == 1:
        arr[0] = -1
        return arr
    for i in range(len(arr) - 1):
        arr[i] = max(arr[i + 1 :])
    arr[-1] = -1
    return arr


